import React from 'react';
import Header from './Header';
import Description from './Description';
import Cycle from './Cycle';
import Nav from './Nav';
import { Container, Row, Col } from 'react-grid-system';
function Main() {
  return (
    <div>


      <Row style={{color:"red",width:"100%",background:"black",align:"center",padding:"1%",justifyContent:"center"}}>
        <Header />               
      </Row>
      <Row>
          <Col style={{width:"60%",background:"aqua",padding:"20%"}}>
              <Cycle />
          </Col>
          <Col sm={4} style={{background:"blue",padding:"20%"}}>
              <Description />
          </Col>
      </Row>    

    </div>
  );
}

export default Main;
